        let descuentos = 0;
        for (const detalle of this.detalles) {
            if (detalle.percent === false) {
                detalle.subtotal = detalle.costo;
                if (detalle.descuento === true) {
                    descuentos += detalle.subtotal;
                    this.factura.total = this.factura.total - detalle.costo;
                }
                if (detalle.descuento === false) {
                    importes += detalle.subtotal;
                    this.factura.total = this.factura.total + detalle.costo;
                }
                detalle.total = this.factura.total;
            }
            else if (detalle.percent === true) {
                detalle.subtotal = (detalle.costo / 100) * this.factura.total;
                if (detalle.descuento === true) {
                    descuentos += detalle.subtotal;
                    detalle.total = this.factura.total - detalle.subtotal;
                }
                if (detalle.descuento === false) {
                    importes += detalle.subtotal;
                    detalle.total = this.factura.total + detalle.subtotal;
                }
                this.factura.total = detalle.total;
            }
        }
        this.factura.total = parseFloat(this.factura.total.toFixed(2));
        const exceso = this.register.excessCosto;
        const subtotal = importes + exceso - descuentos;
        this.factura.subtotal = subtotal;
        this.factura.importes = importes;
        this.factura.descuentos = descuentos;
        const base = this.register.base + exceso + importes;
